window.bookSummaryJSON = "<p>I never imagined my first trip to Italy would be to bury my father. But there I was in the beautiful cathedral, alone, with my father’s casket and a handful of soldiers to keep me safe.<br> <br> It didn’t occur to me that anyone would disrupt the sanctity of the church. Would march in, weapons in hand, and turn my world upside down.<br> <br> But the Caballero brothers have no regard for the church and even less for my family.<br> <br> They destroyed the peace of that sad occasion.<br> They desecrated my father’s body.<br> And they took what they wanted. Me.<br> <br> I’m a princess in a tower in a breathtaking villa.<br> My bedroom overlooks the turquoise sea, but the door is locked.<br> <br> And I have to contend with not one but two dragons.</p>"; 
